  document.addEventListener("DOMContentLoaded", function () {
            let button1 = document.getElementById("button1");
            let button2 = document.getElementById("button2");

            let isButton1Highlighted = false;
            let isButton2Highlighted = false;

            document.addEventListener("keydown", function (event) {
                if (event.key === "a") {
                    if (!isButton1Highlighted) {
                        button1.classList.add("highlighted");
                        isButton1Highlighted = true;
                    } else {
                        button1.click();
                    }
                } else if (event.key === "s") {
                    if (!isButton2Highlighted) {
                        button2.classList.add("highlighted");
                        isButton2Highlighted = true;
                    } else {
                        button2.click();
                    }
                }
            });

            button1.addEventListener("click", function () {
                // Reset state
                button1.classList.remove("highlighted");
                isButton1Highlighted = false;
            });

            button2.addEventListener("click", function () {
                // Reset state
                button2.classList.remove("highlighted");
                isButton2Highlighted = false;
            });
        });












